<script lang="ts" setup>
import {ref, defineProps, onMounted} from "vue";
import {addTranslate, centerSvgEl} from "@/scripts/positioning";

const elements: { [key: string]: SVGSVGElement | null } = {
  catThinAlive: null,
  catThickAlive: null,
  catThinDead: null,
  catThickDead: null,
  dustparticleA: null,
  dustparticleB: null,
  electron: null,
  dust: null,
  light: null,
  warmth: null
}

function click() {
  console.log('click clicked');
  (document.querySelector('#pointer')! as SVGElement).style.transform = `rotate(${Math.random() * 90}deg)`;

  setAmountVisible('light', Math.floor(Math.random() * 10));
}

function setAmountVisible(type: string, amountToBeVisible: number) {
  const allChildren: SVGElement[] = Array.from(elements[type]!.children) as SVGElement[];
  const visibleChilren = allChildren.filter(e => e.style.display !== 'none');
  const invisibleChilren = allChildren.filter(e => e.style.display === 'none');
  console.log('allChilren = ', allChildren)
  console.log('visibleChilren = ', visibleChilren)
  console.log('invisibleChilren = ', invisibleChilren)

  const needMore = visibleChilren.length < amountToBeVisible;
  const listToPickFrom = needMore ? invisibleChilren : visibleChilren;
  console.log('listToPickFrom = ', listToPickFrom)
  for (let i = 0; i < Math.abs(amountToBeVisible - visibleChilren.length); i++) {
    const randomIndex = Math.floor(Math.random() * listToPickFrom.length);
    console.log('randomIndex = ', randomIndex)
    const randomItem = listToPickFrom[randomIndex];
    console.log('randomItem = ', randomItem)
    randomItem.style.display = needMore ? '' : 'none';
    listToPickFrom.splice(listToPickFrom.indexOf(randomItem));
  }
}


onMounted(() => {
  for (let key in elements) {
    elements[key] = document.querySelector('#' + key);
  }
  for (let type of ['warmth', 'light', 'dust']) {
    (Array.from(elements[type]!.children) as SVGElement[]).forEach(e => e.style.display = 'none');
  }


